    # O(log n) time complexity - binary search
    left, right = 0, len(selected_values) - 1

    while left <= right:
        mid = (left + right) // 2
        if selected_values[mid] == input_collection:
            return mid
        elif selected_values[mid] < input_collection:
            left = mid + 1
        else:
            right = mid - 1

    return -1

